/** @format */

import React from 'react';
import { SupplierList } from '../TextInfo';
import ExpBlock from '../components/ExpBlock';

const Suppliers = () => {
	return (
		<div className='container_page'>
			<h1 className='title_exp'>Suppliers Supported</h1>
			{SupplierList.map((item, index) => {
				return;
				<span key={index}>
					<ExpBlock i={index} />
				</span>;
			})}
		</div>
	);
};

export default Suppliers;
